import React, { useEffect, useState } from "react";
import { Button, StyleSheet, Text, View ,FlatList,TouchableOpacity } from "react-native";
import vjezbeServer from '../src/services/vjezbe'
import GridPrikaz from "../components/GridPrikaz"

const Kategorije = (props) => {

const [vjezbe, postaviVjezbe]=useState([])

  useEffect( ()=>{
    console.log("effect hook");
    vjezbeServer.dohvatiSve().then((response) => {
      console.log("Podaci ucitani");
      postaviVjezbe(response.data)
    })
    // .catch(error =>{
    //   alert(`Greska`)
    // })
  })
  const kategorije = [...new Set(vjezbe.map(v => v.kategorija))]
  
  const renderGrid = (kategorije) => {
    return (
      <GridPrikaz 
      naziv={kategorije.item}
      odabir={ ()=> {
        props.navigation.navigate({
               routeName: 'JednaKategorija',
               params: {
                 katNaziv: kategorije.item
     } })  } }  
     />
 )}
   return (
    <View style={stil.ekran}>    
       <FlatList data={kategorije} renderItem={renderGrid} />
      <Button title= 'Odjava' 
   onPress={()=> { props.navigation.navigate('Login') }}/>
    </View>
   );
 };

const stil = StyleSheet.create({
  gridElement: {
    flex: 1,
    margin: 15,
    height: 200,
    borderColor:'black',
    borderWidth:1
  },
  container: {
    flex: 1,
    justifyContent: 'center',
    backgroundColor: '#74F6F7',
  },
  video: {
    alignSelf: 'center',
    width: 320,
    height: 200,
  },
  ekran: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
});

export default Kategorije;
